// SPDX-License-Identifier: GPL-3.0-only
pragma solidity ^0.8.0;

import "./ElvatePair.sol";

import "../node_modules/@openzeppelin/contracts/utils/math/SafeMath.sol";

/// @author aussedatlo
/// @title manager of Pair Subscriptions
abstract contract ElvateSubscription is ElvatePair {
    using SafeMath for uint256;

    /// subscription structure
    struct Subscription {
        uint256 amountIn;
        uint256 pairId;
        address owner;
    }

    event SubscriptionCreated(Subscription subscription);
    event SubscriptionEdited(Subscription subscription);

    constructor(address _WBNBAddress) ElvatePair(_WBNBAddress) {}

    /// array of all subscriptions
    Subscription[] public allSubscriptions;
    /// subscriptions id by owner, pair id
    mapping(address => mapping(uint256 => uint256))
        public subscriptionByUserPairId;

    /// @dev verify if subscription of signer for pair tokenIn tokenOut exist
    /// @param _tokenIn address of tokenIn
    /// @param _tokenOut address of tokenOut
    modifier onlyExistingSubscription(address _tokenIn, address _tokenOut) {
        uint256 pairId = pairByTokenInOut[_tokenIn][_tokenOut].id;
        uint256 subId = subscriptionByUserPairId[msg.sender][pairId];
        require(
            allSubscriptions[subId].owner == msg.sender &&
                allSubscriptions[subId].pairId == pairId,
            "Subscription not found"
        );
        _;
    }

    /// @dev verify if subscription of signer for pair tokenIn tokenOut don't exist
    /// @param _tokenIn address of tokenIn
    /// @param _tokenOut address of tokenOut
    modifier onlyNonExistingSubscription(address _tokenIn, address _tokenOut) {
        if (allSubscriptions.length > 0) {
            uint256 pairId = pairByTokenInOut[_tokenIn][_tokenOut].id;
            uint256 subId = subscriptionByUserPairId[msg.sender][pairId];
            require(
                allSubscriptions[subId].owner != msg.sender ||
                    allSubscriptions[subId].pairId != pairId,
                "Subscription already exist"
            );
        }
        _;
    }

    /// @dev subscribe to a pair
    /// @param _tokenIn address of tokenIn
    /// @param _tokenOut address of tokenOut
    /// @param _amountIn amount to put on each buy
    /// @notice available only if pair exist and
    ///         if no subscription to this pair exist
    function subscribeToPairByTokenInOut(
        address _tokenIn,
        address _tokenOut,
        uint256 _amountIn
    )
        external
        onlyNonExistingSubscription(_tokenIn, _tokenOut)
        onlyExistingPair(_tokenIn, _tokenOut)
    {
        uint256 pairId = pairByTokenInOut[_tokenIn][_tokenOut].id;
        Subscription memory sub = Subscription(_amountIn, pairId, msg.sender);
        allSubscriptions.push(sub);
        subscriptionByUserPairId[msg.sender][pairId] = SafeMath.sub(
            allSubscriptions.length,
            1
        );
        emit SubscriptionCreated(sub);
    }

    /// @dev edit subscription
    /// @param _tokenIn address of tokenIn
    /// @param _tokenOut address of tokenOut
    /// @param _amountIn amount to put on each buy
    /// @notice available only if pair exist and
    ///         if subscription to this pair exist
    function editSubscriptionByTokenInOut(
        address _tokenIn,
        address _tokenOut,
        uint256 _amountIn
    )
        external
        onlyExistingSubscription(_tokenIn, _tokenOut)
        onlyExistingPair(_tokenIn, _tokenOut)
    {
        uint256 pairId = pairByTokenInOut[_tokenIn][_tokenOut].id;
        uint256 subId = subscriptionByUserPairId[msg.sender][pairId];
        Subscription storage sub = allSubscriptions[subId];
        sub.amountIn = _amountIn;
        emit SubscriptionEdited(allSubscriptions[subId]);
    }

    /// @dev get all subscriptions
    /// @return array of all subscriptions
    function getAllSubscriptions() public view returns (Subscription[] memory) {
        return allSubscriptions;
    }
}

